import React, { Component } from 'react';
import MultiseriesChart from './views/overview/Multiseries Chart';

let contStyles = {
    backgroundColor: 'red',
    width: '70vw'
}

class App extends Component {

  render() {    
    return (
      <div className="container" style={contStyles}>
        <MultiseriesChart/>
      </div>
    );
  }
}

export default App;
